const Letter = () => {
  return (
    <>
      <section className="Letter">
        <div className="container let">
          <div className="letR">
            <img src="velope.png" alt="Flyingenvelope" />
          </div>
          <div className="retR">
            <button></button>
            <h1>Available for your Smartphones</h1>
            <div className="leftRow">
              <img
                src="gg.png"
                alt="applestoreimage"
                style={{ width: 220, height: 80 }}
              />
              <img
                src="gg.png"
                alt="applestoreimage"
                style={{ width: 220, height: 80 }}
              />
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Letter;
